import { Link } from "react-router-dom";
import "../header.css";
import {React} from "react";
import {useNavigate} from "react-router-dom";

let navigate = useNavigate();
const routechange = ()=>{
    let path = "/login";
    navigate (path);
}

function Header(){
    return(
        <div>
            <nav className="nvgbar">
                <ul style={{listStyleType:"none"}}>
                    <li>Home</li>
                    <li>Our Services</li>
                    <li>About Us</li>
                    <li>Extras</li>
                    <button onClick={routechange()} type="button" id="strbtn" className="strbtn">Get Started!</button>
                </ul>
                

                
            </nav>
        </div>
    );
}
export default Header
